{"result":"@-moz-document domain("chat.openai.com") {
  html,
  body,
  div,
  span,
  applet,
  object,
  iframe,
  h1,
  h2,
  h3,
  h4,
  h5,
  h6,
  p,
  blockquote,
  pre,
  a,
  abbr,
  acronym,
  address,
  big,
  cite,
  code,
  del,
  dfn,
  em,
  img,
  ins,
  kbd,
  q,
  s,
  samp,
  small,
  strike,
  strong,
  sub,
  sup,
  tt,
  var,
  b,
  u,
  i,
  center,
  dl,
  dt,
  dd,
  ol,
  ul,
  li,
  fieldset,
  form,
  label,
  legend,
  table,
  caption,
  tbody,
  tfoot,
  thead,
  tr,
  th,
  td,
  article,
  aside,
  canvas,
  details,
  embed,
  figure,
  figcaption,
  footer,
  header,
  hgroup,
  menu,
  nav,
  output,
  ruby,
  section,
  summary,
  time,
  mark,
  audio,
  video {
    margin: 0 !important;
    padding: 0 !important;
    border: 0 !important;
    font-size: 100% !important;
    font: inherit !important;
    vertical-align: baseline !important;
    background: transparent !important;
    color: initial !important;
    text-align: left !important;
  }

  /* HTML5 display-role reset for older browsers */
  article,
  aside,
  details,
  figcaption,
  figure,
  footer,
  header,
  hgroup,
  menu,
  nav,
  section {
    display: block !important;
  }

  body {
    line-height: 1 !important;
  }

  ol,
  ul {
    list-style: none !important;
  }

  blockquote,
  q {
    quotes: none !important;
  }

  blockquote:before,
  blockquote:after,
  q:before,
  q:after {
    content: "" !important;
  }

  table {
    border-collapse: collapse !important;
    border-spacing: 0 !important;
  }

  /* Additional resets for form elements */
  input,
  button,
  select,
  textarea {
    margin: 0 !important;
    padding: 0 !important;
    border: 0 !important;
    background: transparent !important;
    color: initial !important;
    font-size: 100% !important;
    line-height: 1 !important;
    outline: none !important;
  }

  .text-gray-500 {
    display: none!important;
  }
  .text-gray-400 {
    display: none!important;
  }
  .text-gray-200 {
    display: none!important;
  }
  .text-gray-600 {
    display: none!important;
  }
  .flex-shrink-0 {
    display: none!important;
  }
	  .flex-1 {
      padding-bottom: 19px!important;
  }
	  * {
      max-width: 1000rem!important;
  }
}
"}
